import info from '../componentes/json/vide.json'

const Videos = () => {

    return(<div>
        {
            info.map(vid =>{
                return(<div key={vid.id}>
                            <iframe src="https://www.youtube.com/embed/t7DcmGCV8kE?autoplay=1&mute=1&loop=1" frameborder="0" allow="autoplay" encrypted-media allowfullscreen className="video"/>
                        </div>
                    )
            })
        }

    </div>)

}

export default Videos;
